import React, { useEffect, useState } from 'react';
import Questionnaire from './Questionnaire';
import { supabase } from './supabaseClient';
import Chart from 'chart.js/auto';
import 'chartjs-adapter-moment';
import './styles.css'; // Styling
import { useNavigate } from 'react-router-dom';  // Allows redirecting after logout


const App = () => {
  const [user, setUser] = useState(null);  // Get the logged-in user from Supabase
  const [airQualityData, setAirQualityData] = useState([]);
  const [selectedCity, setSelectedCity] = useState('');
  const [hasCompletedQuestionnaire, setHasCompletedQuestionnaire] = useState(false);
  const [pm25Chart, setPm25Chart] = useState(null);
  const [pm10Chart, setPm10Chart] = useState(null);
  const [error, setError] = useState(null);  // Define error state to store errors
  const [loading, setLoading] = useState(true);
  const [hvac, setHVAC] = useState(false);
  const [ecologicca, setEcologicca] = useState(false);
  const [daysOver10, setDaysOver10] = useState(0);
  const [daysOver20, setDaysOver20] = useState(0);
  const [daysOver50, setDaysOver50] = useState(0);
  const navigate = useNavigate();

  // Fetch the logged-in user information
  useEffect(() => {
    const fetchUser = async () => {
      try {
        const { data: { user } } = await supabase.auth.getUser();
        setUser(user);
        setLoading(false); // Set loading to false once user is fetched
      } catch (error) {
        setError('Error fetching user');
        setLoading(false);  // Set loading to false on error
      }
    };
    fetchUser();
  }, []);

  // Calculate key data points
  const calculateKeyDataPoints = (cityData) => {
    const over10 = cityData.filter(row => row['PM 2.5'] > 10).length;
    const over20 = cityData.filter(row => row['PM 2.5'] > 20).length;
    const over50 = cityData.filter(row => row['PM 2.5'] > 50).length;

    setDaysOver10(over10);
    setDaysOver20(over20);
    setDaysOver50(over50);
  };

  // Apply adjustments based on user preferences
  const applyAdjustments = (hasHVAC, hasEcologgica) => {
    let pm25Multiplier = 1, pm10Multiplier = 1;

    if (hasHVAC) pm25Multiplier -= 0.40;
    if (hasEcologgica) {
      pm25Multiplier -= 0.25;
      pm10Multiplier -= 0.25;
    }

    setHVAC(hasHVAC);
    setEcologicca(hasEcologgica);
    updateChartsDataWithAdjustments(pm25Multiplier, pm10Multiplier);
  };

  // Fetch user preferences to check if they've completed the questionnaire
  useEffect(() => {
    const fetchUserPreferences = async () => {
      if (!user) return;
      try {
        const { data } = await supabase
          .from('user_preferences')
          .select('*')
          .eq('user_id', user.id)
          .single();

        if (data) {
          setHasCompletedQuestionnaire(true);
          setSelectedCity(data.city);
          applyAdjustments(data.has_HVAC, data.has_ecologgica);
        } else {
          setHasCompletedQuestionnaire(false);
        }
      } catch (error) {
        setError('Error fetching preferences');
      } finally {
        setLoading(false); 
      }
    };
    fetchUserPreferences();
  }, [user]);

  // Fetch air quality data and initialize charts
  useEffect(() => {
    if (!hasCompletedQuestionnaire) return;

    const fetchAirQualityData = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/airqualitydata');
        if (!response.ok) {
          throw new Error(`Error fetching air quality data: ${response.statusText}`);
        }
        const data = await response.json();
        setAirQualityData(data);
        initCharts(data);
        calculateKeyDataPoints(data.filter(row => row.City === selectedCity)); // Calculate key data points
      } catch (error) {
        setError("Error fetching air quality data");
      }
    };
    fetchAirQualityData();
  }, [hasCompletedQuestionnaire]);

  // Initialize charts for PM 2.5 and PM 10
  const updateChartsDataWithAdjustments = (pm25Multiplier, pm10Multiplier) => {
    const cityData = airQualityData.filter(row => row.City === selectedCity);
    const labels = cityData.map(row => row.Date);
    const pm25Data = cityData.map(row => parseFloat(row['PM 2.5']) * pm25Multiplier);
    const pm10Data = cityData.map(row => parseFloat(row['PM 10']) * pm10Multiplier);

    if (pm25Chart) {
      pm25Chart.data.labels = labels;
      pm25Chart.data.datasets[0].data = pm25Data;
      pm25Chart.update(); 
    }

    if (pm10Chart) {
      pm10Chart.data.labels = labels;
      pm10Chart.data.datasets[0].data = pm10Data;
      pm10Chart.update(); 
    }
  };

  const initCharts = (data) => {
    const ctx25 = document.getElementById('pm25Chart').getContext('2d');
    const ctx10 = document.getElementById('pm10Chart').getContext('2d');

    const cityData = data.filter(row => row.City === selectedCity);
    const labels = cityData.map(row => row.Date);
    const pm25Data = cityData.map(row => row['PM 2.5']);
    const pm10Data = cityData.map(row => row['PM 10']);

    const newPm25Chart = new Chart(ctx25, {
      type: 'line',
      data: {
        labels: labels,
        datasets: [{ 
          label: 'PM 2.5', 
          data: pm25Data, 
          borderColor: 'rgb(75, 192, 192)', 
          tension: 0.1 
        }],
      },
      options: {
        scales: {
          x: { 
            type: 'time', 
            time: {
              unit: 'day'
            },
            title: { display: true, text: 'Date' }
          },
          y: { beginAtZero: true, title: { display: true, text: 'µg/m³' } }
        }
      }
    });

    const newPm10Chart = new Chart(ctx10, {
      type: 'line',
      data: {
        labels: labels,
        datasets: [{ 
          label: 'PM 10', 
          data: pm10Data, 
          borderColor: 'rgb(255, 99, 132)', 
          tension: 0.1 
        }],
      },
      options: {
        scales: {
          x: { 
            type: 'time',
            time: {
              unit: 'day'
            },
            title: { display: true, text: 'Date' }
          },
          y: { beginAtZero: true, title: { display: true, text: 'µg/m³' } }
        }
      }
    });

    setPm25Chart(newPm25Chart);
    setPm10Chart(newPm10Chart);
  };

  // Handle city change from dropdown
  const handleCityChange = (event) => {
    const city = event.target.value;
    setSelectedCity(city);
    updateChartsDataWithAdjustments(1, 1);
  };

  const handleLogout = async () => {
    const { error } = await supabase.auth.signOut();
    if (!error) {
      navigate('/login');  // Correct usage of navigate
    } else {
      setError('Failed to logout');
    }
  };

  // Return statement with changes
  return (
    <div className="dashboard-container">
      {error && <p className="error-message">{error}</p>}
      {hasCompletedQuestionnaire ? (
        <div className="dashboard">
          <h1>Air Quality Dashboard</h1>
          <h1>Air Quality Dashboard</h1>
        {/* Logout Button */}
        <button onClick={handleLogout} className="button">Logout</button>  {/* Apply your button styling class */}
          {/* City dropdown directly under title */}
          <div>
            <select id="city-select" value={selectedCity} onChange={handleCityChange}>
              <option value="">Select a City</option>
              {[...new Set(airQualityData.map(row => row.City))].map(city => (
                <option key={city} value={city}>{city}</option>
              ))}
            </select>
          </div>
          <div className="upper-section">
            {/* Left box for city and HVAC/Ecologicca */}
            <div className="left-box">
              <h2>Your Preferences</h2>
              <p>City: {selectedCity}</p>
              <p>HVAC: {hvac ? 'Yes' : 'No'}</p>
              <p>Ecologicca: {ecologicca ? 'Yes' : 'No'}</p>
            </div>
             {/* Key data points */}
             <div className="right-box">
              <h2>Key Data Points</h2>
              <ul>
                <li>{daysOver10} days over 10 µg/m³</li>
                <li>{daysOver20} days over 20 µg/m³</li>
                <li>{daysOver50} days over 50 µg/m³</li>
              </ul>
            </div>
          </div>
          <div className="chart-section">
            <div className="chart-container">
              <h3>PM 2.5 Levels</h3>
              <canvas id="pm25Chart"></canvas>
            </div>
            <div className="chart-container">
              <h3>PM 10 Levels</h3>
              <canvas id="pm10Chart"></canvas>
            </div>
          </div>
        </div>
      ) : (
        <Questionnaire user={user} />
      )}
    </div>
  );
};

export default App;
